local function unescape(s)
    local t = {}
    for oct in s:gmatch("\\(%d%d%d)") do
        table.insert(t, string.char(tonumber(oct)))
    end
    return table.concat(t)
end

local function xor_decrypt(str, key)
    local out = ""
    for i = 1, #str do
        out = out .. string.char(string.byte(str, i) ~ key)
    end
    return out
end

